import React, { useState, useEffect } from 'react';
import axios from 'axios';

function HomePage() {
    const [userData, setUserData] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            try {
                // Assume you have endpoint that returns user-specific data and requires a user ID
                // This user ID would typically come from authentication context or local storage
                // For now, we'll use a static user ID for the demonstration.
                const userId = 'exampleUserId'; 
                const response = await axios.get(`http://localhost:5162/api/Users/${userId}/data`);
                setUserData(response.data);
            } catch (error) {
                console.error("Error fetching user data: ", error);
            }
        }

        fetchData();
    }, []);

    if (!userData) {
        return <div>Loading...</div>;
    }

    return (
        <div>
            <h1>Welcome, {userData.username}!</h1>
            {/* Display user-specific data here */}
            <div>
                <h2>Your Data:</h2>
                {/* This will depend on the structure of your user data */}
                <p>{JSON.stringify(userData)}</p>
            </div>
        </div>
    );
}

export default HomePage;
